// Navbar.js
//import { Link } from 'react-router-dom';
import { Link } from "react-router-dom";


const Navbar = () => {
  return (
    <nav className="nav-menu">
      <Link to="/">Rooms</Link>
      <Link to="/my-bookings">My Bookings</Link>
      <Link to="/admin">Admin Panel</Link>
    </nav>
  );
};

export default Navbar;
